import React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';

function TechnicalAnalyzeComp(props) {
    const condition = ["5ma突破30ma黃金交叉", "5ma突破30ma死亡交叉", "KD黃金交叉"]


    const handleToggle = (value) => {
        if(!props.conditions.includes(value)){
            props.setConditions(props.conditions.append(value))
        }
    }

    return (
        <>
            <List component = "div" role = "list">
                {condition.map((item, i) => {
                    return(
                        <ListItem key = { i } role = "listitem" button = { true } onClick = { handleToggle(item) }>
                            <ListItemText primary = { item } />
                        </ListItem>
                    )
                })}
            </List>
        </>
    );
}

export default TechnicalAnalyzeComp;
